export default function AboutMe() {
  return (
    <section className="container center">
      <div className="center" style={{ width: '100%' }}>
        <h1
          style={{ color: '#cc005f', fontSize: '1.6rem', lineHeight: '1.5rem' }}
        >
          Descubra
        </h1>
        <h2 style={{ fontSize: '3.6rem', lineHeight: '110%' }}>Sobre mim</h2>
      </div>
    </section>
  );
}
